import React from "react";
import { NavLink } from "react-router-dom";
import Form from "./Form";

const CreateShop = () => {
  const items = [
    {
      id: 1,
      labelName: "الاسم كاملاً",
      type: "text",
    },
    {
      id: 2,
      labelName: "البريد الإلكتروني",
      type: "email",
    },
    {
      id: 3,
      labelName: "رقم الهاتف",
      type: "phone",
    },
    {
      id: 4,
      labelName: "كلمة المرور",
      type: "password",
    },
  ];

  const submitValue = "التالي";

  const nextHandler = () => {
    console.log("Next");
  };

  return (
    <div className="create-shop">
      <h1 className="title-store">أنشئ متجرك بخطوتين</h1>
      <Form items={items} submitValue={submitValue} onClick={nextHandler} />
      <p>
        هل لديك حساب في تجربة <NavLink to="login">تسجيل الدخول</NavLink>
      </p>
    </div>
  );
};

export default CreateShop;
